import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import './App.css'; // Ensure Tailwind is imported in this file

// Temporary page components
const HomePage = () => (
  <div>
    {/* Your Home Page content */}
    <h2>Welcome to the Job Hiring Platform</h2>
  </div>
);

const JobsPage = () => (
  <div>
    <h2>Find Jobs</h2>
    {/* Jobs listing content */}
  </div>
);

const PostJobPage = () => (
  <div>
    <h2>Post a Job</h2>
    {/* Job posting form content */}
  </div>
);

function App() {
  return (
    <Router>
      <div className="min-h-screen flex flex-col bg-black">
        {/* Header */}
        <header className="bg-blue-900 text-white p-4">
          <div className="container mx-auto flex justify-between items-center">
            <h1 className="text-xl">Job Hiring Platform</h1>
            <nav>
              <Link to="/" className="inline-block p-2">Home</Link>
              <Link to="/jobs" className="inline-block p-2">Find Jobs</Link>
              <Link to="/post-job" className="inline-block p-2">Post a Job</Link>
            </nav>
          </div>
        </header>

        {/* Routes */}
        <Switch>
          <Route path="/jobs">
            <JobsPage />
          </Route>
          <Route path="/post-job">
            <PostJobPage />
          </Route>
          <Route path="/">
            <HomePage />
          </Route>
        </Switch>

        {/* Footer */}
        <footer className="bg-gray-200 text-center p-4">
          Â© 2024 Technology Talent Holdings (TTH), Inc.
        </footer>
      </div>
    </Router>
  );
}

export default App;
